INSERT INTO `searchindex` VALUES (12,'mediawiki extensions',' theu800 following extensions areu800 installed inu800 theu800 goctalab wiki. refer tou800 theu800 documentation foru800 howu800 tou800 useu800. * * * '),(13,'revoques yu800 pinturas naturales cocachimbau82epdfu800',' revoques naturales enu800 cocachimba - andri matsuda ruta deu800 lau800 bioconstruccion experiencia deu800 nuestra residente conu800 arcillas deu800 lau800 zona conu800 aplicacion deu800 calu800 suero deu800 leche yu800 bosta deu800 vaca fermentada para mayor resistencia au800 lau800 lluvia yu800 abrasion. tabla deu800 formulas adjuntas conu800 soporte deu800 imagenes. '),(14,'revoques naturales cocachimba - andri matsuda',' revoques naturales - andri matsuda ruta deu800 lau800 bioconstruccion experiencia deu800 nuestra residente goctalab andri matsuda . combinacion deu800 arcillas deu800 lau800 zona conu800 aplicacion deu800 calu800 suero deu800 leche yu800 bosta deu800 vaca fermentada. tabla deu800 formulas adjunta conu800 imagenes deu800 soporte. media revoques yu800 pinturas naturales cocachimbau82epdfu800 '),(11,'website development workflow',' copies ofu800 theu800 code foru800 theu800 wordpress site andu800 theu800 mediawiki exit inu800 3u800 places * onu800 theu800 local development machine located atu800 goctalab. * onu800 au800 gitu800 server atu800 github . * inu800 production atu800 generally development isu800 done onu800 theu800 local development machine then pushed tou800 theu800 gitu800 server then pulled into theu800 production server. however ifu800 changes need tou800 beu800 done remotely then basically theu800 opposite needs tou800 occur before resuming work onu800 theu800 local development machine. described below areu800 howu800 tou800 runu800 theu800 scripts that perform these actions. allu800 theu800 scripts areu800 located onu800 theu800 local development machine atu800 home goctalab sever_scripts  dou800 notu800 under anyu800 circumstances make changes onu800 both theu800 development machine andu800 theu800 production server without running theu800 script.  push from local development machine tou800 production server push from local development machine tou800 production server push from local development machine tou800 production server there areu800 individual scripts foru800 wordpress andu800 mediawiki. tou800 push from theu800 development machine tou800 theu800 production server cdu800 into theu800 gl_website_dev_scripts directory andu800 tou800 runu800 theu800 scripts asu800 follows cdu800 home goctalab gl_website_dev_scripts sudo shu800 . push_wpu82eshu800 sudo shu800 . push_wikiu82eshu800  note that after pushing oru800 pulling theu800 wordpress site youu800 must reset theu800 background image because foru800 some reason itu800 isu800 being setu800 byu800 anu800 absolute path.  this will beu800 theu800 primary workflow. seeu800 below foru800 theu800 less common useu800 case inu800 reverse. pull from production server tou800 local development machine pull from production server tou800 local development machine pull from production server tou800 local development machine because these scripts will andu800 should beu800 used rarely they have been placed inu800 au800 subdirectory called pull_scripts. cdu800 home goctalab gl_website_dev_scripts pull_scripts sudo shu800 . pull_wpu82eshu800 sudo shu800 . pull_wikiu82eshu800 ');
/*!40000 ALTER TABLE `searchindex` ENABLE KEYS */;
