INSERT INTO `text` VALUES (1,'<strong>MediaWiki se ha instalado.</strong>\n\nConsulta la [https://meta.wikimedia.org/wiki/Help:Contents/es gua del usuario] para obtener informacin sobre el uso del software wiki.\n\n== Primeros pasos ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Lista de ajustes de configuracin]\n* [https://www.mediawiki.org/wiki/Manual:FAQ/es Preguntas frecuentes sobre MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de publicacin de MediaWiki]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Traducir MediaWiki en tu idioma]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Aprende cmo combatir el spam en tu wiki]','utf-8'),(2,'== Push to Server ==\n\n=== Backup Database ===','utf-8'),(3,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\ncd /var/www/html/wp/\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql','utf-8'),(4,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\n\ncd /var/www/html/wp/\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql','utf-8'),(5,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\n\ncd /var/www/html/wp/\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql\n\ngit add -A && git commit -m \"Your Message\"','utf-8'),(6,'== Push to Server ==\n\n=== WP Site ===\n=== Root Access and CD ===\n\n<code> sudo -i </code>\n\ncd /var/www/html/wp/\n\n=== Backup Database ===\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql\n\ngit add -A && git commit -m \"[your commit message]\"','utf-8'),(7,'== Push to Server ==\n\n=== WP Site ===\n=== Root Access and Change Directory ===\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n=== Backup Database ===\